<script type="text/ecmascript">
var SVG_IDX1_SVGRoot = null;
var SVG_IDX1_TrueCoords = null;
var SVG_IDX1_singleTip = null;
var SVG_IDX1_singleBox = null;
var SVG_IDX1_singleText = null;
var SVG_IDX1_tiptspan = null;
var SVG_IDX1_attrScale = 1;
var SVG_IDX1_rightEdge = null;
var SVG_IDX1_SVGHeight = null;
var SVG_IDX1_SVGWidth = null;
function SVG_IDX1_Init(anchor) {
   SVG_IDX1_SVGRoot = document.getElementById(anchor);
   SVG_IDX1_TrueCoords = SVG_IDX1_SVGRoot.createSVGPoint();
   SVG_IDX1_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX1_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX1_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX1_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX1_tiptspan.firstChild.nodeValue = null;
   SVG_IDX1_SVGRoot.addEventListener('mousemove', SVG_IDX1_ShowTooltip, false);
   SVG_IDX1_SVGRoot.addEventListener('mouseout', SVG_IDX1_HideTooltip, false);
   SVG_IDX1_SVGHeight = SVG_IDX1_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX1_SVGWidth = SVG_IDX1_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX1_SVGHeight)) && !isNaN(parseFloat(SVG_IDX1_SVGWidth)))
      SVG_IDX1_GetHW();
}
function SVG_IDX1_GetHW()
{
    if (SVG_IDX1_SVGWidth != null && SVG_IDX1_SVGWidth != "") {
       if (SVG_IDX1_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX1_SVGWidth.replace(/%/,""))/100;
          SVG_IDX1_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX1_SVGWidth.match(/in/))
          SVG_IDX1_SVGWidth = parseFloat(SVG_IDX1_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX1_SVGWidth.match(/cm/))
          SVG_IDX1_SVGWidth = parseFloat(SVG_IDX1_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX1_SVGWidth = parseFloat(SVG_IDX1_SVGWidth);
    }
    if (SVG_IDX1_SVGHeight != null && SVG_IDX1_SVGHeight != "") {
       if (SVG_IDX1_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX1_SVGHeight.replace(/%/,""))/100;
          SVG_IDX1_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX1_SVGHeight.match(/in/))
          SVG_IDX1_SVGHeight = parseFloat(SVG_IDX1_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX1_SVGHeight.match(/cm/))
          SVG_IDX1_SVGHeight = parseFloat(SVG_IDX1_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX1_SVGHeight = parseFloat(SVG_IDX1_SVGHeight);
    }
}
function SVG_IDX1_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX1_rightEdge = (SVG_IDX1_SVGWidth) ? SVG_IDX1_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX1_SVGWidth) > 0 || parseFloat(SVG_IDX1_SVGHeight) > 0)
      var tipScale = 1.875;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX1_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX1_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX1_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX1_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX1_attrScale = tipScale/zoomFactor;
         SVG_IDX1_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX1_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX1_attrScale = 1.5 / zoomFactor;
         SVG_IDX1_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX1_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX1_attrScale = tipScale;
      else {
         if (SVG_IDX1_SVGWidth > 0 || SVG_IDX1_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX1_SVGRoot, null).width,10)/
                                  SVG_IDX1_SVGRoot.clientWidth;
         SVG_IDX1_attrScale = tipScale/zoomFactor;
         SVG_IDX1_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX1_GetTrueCoords(evt)
{
   var trans = SVG_IDX1_SVGRoot.currentTranslate;
   var scale = SVG_IDX1_SVGRoot.currentScale;
   SVG_IDX1_GetScaleFactors();
   var p1    = SVG_IDX1_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX1_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX1_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX1_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX1_HideTooltip( evt )
{
   SVG_IDX1_tiptspan.firstChild.nodeValue = null;
   SVG_IDX1_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX1_ShowTooltip( evt )
{
   SVG_IDX1_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX1_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX1_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX1_singleText.getBBox();
      SVG_IDX1_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX1_attrScale + ',' + SVG_IDX1_attrScale + ')' );
      SVG_IDX1_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX1_attrScale + ',' + SVG_IDX1_attrScale + ')' );
      SVG_IDX1_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 8)/0.8) * SVG_IDX1_attrScale > SVG_IDX1_rightEdge) {
         var xPos = SVG_IDX1_TrueCoords.x - parseInt((outline.width + 8)*SVG_IDX1_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX1_TrueCoords.x;
      if (SVG_IDX1_TrueCoords.y < 16) {
         var yPos = SVG_IDX1_TrueCoords.y + ((outline.height + 16)/0.8)*SVG_IDX1_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX1_TrueCoords.y - parseInt((outline.height + 8)*SVG_IDX1_attrScale);
      }
      else
         var yPos = SVG_IDX1_TrueCoords.y - parseInt((outline.height + 8)*SVG_IDX1_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX1_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX1_singleBox.setAttributeNS(null, 'width', outline.width + 8);
      SVG_IDX1_singleBox.setAttributeNS(null, 'height', outline.height + 8);
      SVG_IDX1_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }
}
</script>

function SVG_IDX2_GetHW()

function SVG_IDX2_GetScaleFactors(evt)

   }
}

<script type="text/ecmascript">
var SVG_IDX3_SVGRoot = null;
var SVG_IDX3_TrueCoords = null;
var SVG_IDX3_singleTip = null;
var SVG_IDX3_singleBox = null;
var SVG_IDX3_singleText = null;
var SVG_IDX3_tiptspan = null;
var SVG_IDX3_attrScale = 1;
var SVG_IDX3_rightEdge = null;
var SVG_IDX3_SVGHeight = null;
var SVG_IDX3_SVGWidth = null;
function SVG_IDX3_Init(anchor) {
   SVG_IDX3_SVGRoot = document.getElementById(anchor);
   SVG_IDX3_TrueCoords = SVG_IDX3_SVGRoot.createSVGPoint();
   SVG_IDX3_singleTip = document.getElementById(anchor + '_singleTip1');
   SVG_IDX3_singleBox = document.getElementById(anchor + '_singleBox1');
   SVG_IDX3_singleText = document.getElementById(anchor + '_singleText1');
   SVG_IDX3_tiptspan = document.getElementById(anchor + '_tiptspan1');
   SVG_IDX3_tiptspan.firstChild.nodeValue = null;
   SVG_IDX3_SVGRoot.addEventListener('mousemove', SVG_IDX3_ShowTooltip, false);
   SVG_IDX3_SVGRoot.addEventListener('mouseout', SVG_IDX3_HideTooltip, false);
   SVG_IDX3_SVGHeight = SVG_IDX3_SVGRoot.getAttributeNS(null, "height");
   SVG_IDX3_SVGWidth = SVG_IDX3_SVGRoot.getAttributeNS(null, "width");
   if (!isNaN(parseFloat(SVG_IDX3_SVGHeight)) && !isNaN(parseFloat(SVG_IDX3_SVGWidth)))
      SVG_IDX3_GetHW();
}
function SVG_IDX3_GetHW()
{
    if (SVG_IDX3_SVGWidth != null && SVG_IDX3_SVGWidth != "") {
       if (SVG_IDX3_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX3_SVGWidth.replace(/%/,""))/100;
          SVG_IDX3_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX3_SVGWidth.match(/in/))
          SVG_IDX3_SVGWidth = parseFloat(SVG_IDX3_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX3_SVGWidth.match(/cm/))
          SVG_IDX3_SVGWidth = parseFloat(SVG_IDX3_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX3_SVGWidth = parseFloat(SVG_IDX3_SVGWidth);
    }
    if (SVG_IDX3_SVGHeight != null && SVG_IDX3_SVGHeight != "") {
       if (SVG_IDX3_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX3_SVGHeight.replace(/%/,""))/100;
          SVG_IDX3_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX3_SVGHeight.match(/in/))
          SVG_IDX3_SVGHeight = parseFloat(SVG_IDX3_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX3_SVGHeight.match(/cm/))
          SVG_IDX3_SVGHeight = parseFloat(SVG_IDX3_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX3_SVGHeight = parseFloat(SVG_IDX3_SVGHeight);
    }
}
function SVG_IDX3_GetScaleFactors(evt)
{
   var zoomFactor = 1;
   windowWidth  = (top.innerWidth==undefined)  ? window.innerWidth  : top.innerWidth;
   windowHeight = (top.innerHeight==undefined) ? window.innerHeight : top.innerHeight;
   SVG_IDX3_rightEdge = (SVG_IDX3_SVGWidth) ? SVG_IDX3_SVGWidth - window.pageXOffset : windowWidth;
   if (parseFloat(SVG_IDX3_SVGWidth) > 0 || parseFloat(SVG_IDX3_SVGHeight) > 0)
      var tipScale = 1.875;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX3_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX3_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX3_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {
      if (screen.deviceXDPI != null && screen.logicalXDPI != null)
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
      SVG_IDX3_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();
      if (ua.indexOf("msie") != -1 || ua.indexOf("trident") != -1) {
         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX3_attrScale = tipScale/zoomFactor;
         SVG_IDX3_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX3_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX3_attrScale = 1.5 / zoomFactor;
         SVG_IDX3_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX3_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX3_attrScale = tipScale;
      else {
         if (SVG_IDX3_SVGWidth > 0 || SVG_IDX3_SVGHeight > 0)
            zoomFactor = 1;
         else
            zoomFactor = parseInt(document.defaultView.getComputedStyle(SVG_IDX3_SVGRoot, null).width,10)/
                                  SVG_IDX3_SVGRoot.clientWidth;
         SVG_IDX3_attrScale = tipScale/zoomFactor;
         SVG_IDX3_rightEdge *= zoomFactor;
      }
   }
}
function SVG_IDX3_GetTrueCoords(evt)
{
   var trans = SVG_IDX3_SVGRoot.currentTranslate;
   var scale = SVG_IDX3_SVGRoot.currentScale;
   SVG_IDX3_GetScaleFactors();
   var p1    = SVG_IDX3_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX3_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;
      }
      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;
      }
      p2 = p1.matrixTransform(m.inverse());
   SVG_IDX3_TrueCoords.x = Math.round(p2.x*100) / 100;
   SVG_IDX3_TrueCoords.y = Math.round(p2.y*100) / 100;
}
function SVG_IDX3_HideTooltip( evt )
{
   SVG_IDX3_tiptspan.firstChild.nodeValue = null;
   SVG_IDX3_singleTip.setAttributeNS(null, 'visibility', 'hidden');
}
function SVG_IDX3_ShowTooltip( evt )
{
   SVG_IDX3_GetTrueCoords( evt );
   var targetElement = evt.target;
   var tspanCount = targetElement.getElementsByTagName('desc').length;
   if (tspanCount == 1) {
      var targetTspan = targetElement.getElementsByTagName('desc').item(0);
      if ( targetTspan) {
         if (targetTspan.firstChild != null)
            SVG_IDX3_tiptspan.firstChild.nodeValue = targetTspan.firstChild.nodeValue; }
   }
   if ( '' != SVG_IDX3_tiptspan.firstChild.nodeValue )
   {
      var outline = SVG_IDX3_singleText.getBBox();
      SVG_IDX3_singleBox.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX3_attrScale + ',' + SVG_IDX3_attrScale + ')' );
      SVG_IDX3_singleText.setAttributeNS(null, 'transform', 'scale(' + SVG_IDX3_attrScale + ',' + SVG_IDX3_attrScale + ')' );
      SVG_IDX3_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 8)/0.8) * SVG_IDX3_attrScale > SVG_IDX3_rightEdge) {
         var xPos = SVG_IDX3_TrueCoords.x - parseInt((outline.width + 8)*SVG_IDX3_attrScale);
         if (xPos < 0)
            xPos = 0;
      }
      else
         var xPos = SVG_IDX3_TrueCoords.x;
      if (SVG_IDX3_TrueCoords.y < 16) {
         var yPos = SVG_IDX3_TrueCoords.y + ((outline.height + 16)/0.8)*SVG_IDX3_attrScale;
         if (yPos > windowHeight)
            yPos = SVG_IDX3_TrueCoords.y - parseInt((outline.height + 8)*SVG_IDX3_attrScale);
      }
      else
         var yPos = SVG_IDX3_TrueCoords.y - parseInt((outline.height + 8)*SVG_IDX3_attrScale);
      if (Number(outline.width == 0))
         SVG_IDX3_singleBox.setAttributeNS(null, 'width', outline.width);
      else
         SVG_IDX3_singleBox.setAttributeNS(null, 'width', outline.width + 8);
      SVG_IDX3_singleBox.setAttributeNS(null, 'height', outline.height + 8);
      SVG_IDX3_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');
   }

function SVG_IDX4_GetHW()
{
    if (SVG_IDX4_SVGWidth != null && SVG_IDX4_SVGWidth != "") {
       if (SVG_IDX4_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX4_SVGWidth.replace(/%/,""))/100;
          SVG_IDX4_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX4_SVGWidth.match(/in/))
          SVG_IDX4_SVGWidth = parseFloat(SVG_IDX4_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX4_SVGWidth.match(/cm/))
          SVG_IDX4_SVGWidth = parseFloat(SVG_IDX4_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX4_SVGWidth = parseFloat(SVG_IDX4_SVGWidth);
    }
    if (SVG_IDX4_SVGHeight != null && SVG_IDX4_SVGHeight != "") {
       if (SVG_IDX4_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX4_SVGHeight.replace(/%/,""))/100;
          SVG_IDX4_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX4_SVGHeight.match(/in/))
          SVG_IDX4_SVGHeight = parseFloat(SVG_IDX4_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX4_SVGHeight.match(/cm/))
          SVG_IDX4_SVGHeight = parseFloat(SVG_IDX4_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX4_SVGHeight = parseFloat(SVG_IDX4_SVGHeight);

function SVG_IDX4_GetScaleFactors(evt)
{

   if (parseFloat(SVG_IDX4_SVGWidth) > 0 || parseFloat(SVG_IDX4_SVGHeight) > 0)
      var tipScale = 1.875;

      var tipYScale  = (screen.height/windowHeight) / SVG_IDX4_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;

   SVG_IDX4_attrScale = tipScale;

   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {

         SVG_IDX4_attrScale = tipScale/zoomFactor;
         SVG_IDX4_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX4_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX4_attrScale = 1.5 / zoomFactor;
         SVG_IDX4_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX4_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX4_attrScale = tipScale;
      else {
         if (SVG_IDX4_SVGWidth > 0 || SVG_IDX4_SVGHeight > 0)
            zoomFactor = 1;
         else

function SVG_IDX4_GetTrueCoords(evt)
{
   var trans = SVG_IDX4_SVGRoot.currentTranslate;
   var scale = SVG_IDX4_SVGRoot.currentScale;
   SVG_IDX4_GetScaleFactors();
   var p1    = SVG_IDX4_SVGRoot.createSVGPoint();
   var p2;
      var m = SVG_IDX4_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {
         p1.x = evt.clientX + window.pageXOffset;
         p1.y = evt.clientY + window.pageYOffset;

      else {
      p1.x = evt.clientX;
      p1.y = evt.clientY;

      SVG_IDX4_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 8)/0.8) * SVG_IDX4_attrScale > SVG_IDX4_rightEdge) {

      SVG_IDX4_singleTip.setAttributeNS(null, 'transform', 'translate(' + xPos + ',' + yPos + ')');

function SVG_IDX5_GetHW()
{
    if (SVG_IDX5_SVGWidth != null && SVG_IDX5_SVGWidth != "") {
       if (SVG_IDX5_SVGWidth.match(/%/)) {
          var factor = parseFloat(SVG_IDX5_SVGWidth.replace(/%/,""))/100;
          SVG_IDX5_SVGWidth = window.innerWidth * factor;
       }
       else if (SVG_IDX5_SVGWidth.match(/in/))
          SVG_IDX5_SVGWidth = parseFloat(SVG_IDX5_SVGWidth.replace(/in/,""))*96;
       else if (SVG_IDX5_SVGWidth.match(/cm/))
          SVG_IDX5_SVGWidth = parseFloat(SVG_IDX5_SVGWidth.replace(/in/,""))*96/2.54;
       else
           SVG_IDX5_SVGWidth = parseFloat(SVG_IDX5_SVGWidth);
    }
    if (SVG_IDX5_SVGHeight != null && SVG_IDX5_SVGHeight != "") {
       if (SVG_IDX5_SVGHeight.match(/%/)) {
          var factor = parseFloat(SVG_IDX5_SVGHeight.replace(/%/,""))/100;
          SVG_IDX5_SVGHeight = window.innerHeight * factor;
       }
       else if (SVG_IDX5_SVGHeight.match(/in/))
          SVG_IDX5_SVGHeight = parseFloat(SVG_IDX5_SVGHeight.replace(/in/,""))*96;
       else if (SVG_IDX5_SVGHeight.match(/cm/))
          SVG_IDX5_SVGHeight = parseFloat(SVG_IDX5_SVGHeight.replace(/in/,""))*96/2.54;
       else
           SVG_IDX5_SVGHeight = parseFloat(SVG_IDX5_SVGHeight);

function SVG_IDX5_GetScaleFactors(evt)
{

   if (parseFloat(SVG_IDX5_SVGWidth) > 0 || parseFloat(SVG_IDX5_SVGHeight) > 0)
      var tipScale = 1.875;
   else {
      var tipXScale  = (screen.width/windowWidth) / SVG_IDX5_SVGRoot.currentScale;
      var tipYScale  = (screen.height/windowHeight) / SVG_IDX5_SVGRoot.currentScale;
      var tipScale   = (tipXScale + tipYScale)/2.0;
   }
   SVG_IDX5_attrScale = tipScale;
   if (navigator.appName == 'Adobe SVG Viewer') {

      SVG_IDX5_attrScale = zoomFactor*tipScale;
   }
   else if (navigator.userAgent != null && navigator.userAgent != '') {
      var ua = navigator.userAgent.toLowerCase();

         zoomFactor = screen.deviceXDPI/screen.logicalXDPI;
         SVG_IDX5_attrScale = tipScale/zoomFactor;
         SVG_IDX5_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("ipad") != -1) {
         zoomFactor = SVG_IDX5_SVGRoot.clientWidth / window.innerWidth;
         SVG_IDX5_attrScale = 1.5 / zoomFactor;
         SVG_IDX5_rightEdge /= zoomFactor;
      }
      else if (ua.indexOf("opera") != -1)
         SVG_IDX5_attrScale = tipScale;
      else if (ua.indexOf("firefox") != -1)
         SVG_IDX5_attrScale = tipScale;
      else {
         if (SVG_IDX5_SVGWidth > 0 || SVG_IDX5_SVGHeight > 0)
            zoomFactor = 1;

function SVG_IDX5_GetTrueCoords(evt)
{

   var p1    = SVG_IDX5_SVGRoot.createSVGPoint();

      var m = SVG_IDX5_SVGRoot.getScreenCTM();
      if (navigator.userAgent.toLowerCase().indexOf("ipad") != -1) {

      SVG_IDX5_singleTip.setAttributeNS(null, 'visibility', 'visible');
      if (evt.clientX + ((outline.width + 8)/0.8) * SVG_IDX5_attrScale > SVG_IDX5_rightEdge) {
         var xPos = SVG_IDX5_TrueCoords.x - parseInt((outline.width + 8)*SVG_IDX5_attrScale);
